(11, 3, 'Es Jeruk - 6', 'Penuhi kebutuhan vitamin c harian dengan kesegaran es jeruk', '2021-09-29-615411a7cee2d.png', NULL, 12, NULL, NULL, '[{\"id\":\"3\",\"position\":1},{\"id\":\"12\",\"position\":2}]', '[]', '[]', '[]', '[]', '7500.00', '0.00', 'percent', '0.00', 'percent', '17:00:00', '20:00:00', 0, 1, 0, '2021-09-02 21:24:06', '2021-09-29 21:45:45'),
(12, 3, 'Ayam Bakar Taliwang - 5', 'Ayam Taliwang adalah masakan khas pulau Lombok . Sensasi rasa manis dan gurih yang meresap ke dalam daging ayam, semakin menambah cita rasa yang memanjakan lidah.', '2021-10-06-615d32cad541b.png', NULL, 42, NULL, NULL, '[{\"id\":\"6\",\"position\":1},{\"id\":\"42\",\"position\":2}]', '[]', '[]', '[]', '[]', '37500.00', '0.00', 'percent', '0.00', 'percent', '17:00:00', '20:00:00', 0, 1, 0, '2021-09-02 21:32:05', '2021-10-05 23:23:22'),
(13, 3, 'Ayam Betutu - 5', 'Ayam betutu merupakan makanan khas Bali. Kuliner satu ini kaya akan rempah dengan cita rasa yang khas', '2021-10-06-615d32dbcb2fc.png', NULL, 43, NULL, NULL, '[{\"id\":\"6\",\"position\":1},{\"id\":\"43\",\"position\":2}]', '[]', '[]', '[]', '[]', '37500.00', '0.00', 'percent', '0.00', 'percent', '17:00:00', '20:00:00', 0, 1, 1, '2021-09-02 21:36:21', '2021-10-07 21:13:27'),
(14, 3, 'Ayam Suwir Sambal Matah - 5', 'Ayam suwir sambal matah  nikmat pedas sambal nusantara dengan rempah yang alami', '2021-10-05-615b957d597cb.png', NULL, 43, NULL, NULL, '[{\"id\":\"6\",\"position\":1},{\"id\":\"43\",\"position\":2}]', '[]', '[]', '[]', '[]', '37500.00', '0.00', 'percent', '0.00', 'percent', '17:00:00', '20:00:00', 0, 1, 0, '2021-09-02 21:43:23', '2021-10-04 17:59:57'),
(15, 3, 'Ayam Geprek Sambal Matah - 5', 'Ayam geprek merupakan salah satu menu makanan yang biasanya dimakan pada saat jam makan siang ataupun malam, cita rasanya yang gurih dan pedas selalu mampu menggugah nafsu makan apalagi dilengkapi dengan sambal matah membuat kenikmatannya meningkat', '2021-10-06-615d32f4cee83.png', NULL, 43, NULL, NULL, '[{\"id\":\"6\",\"position\":1},{\"id\":\"43\",\"position\":2}]', '[]', '[]', '[]', '[]', '37500.00', '0.00', 'percent', '0.00', 'percent', '17:00:00', '20:00:00', 0, 1, 0, '2021-09-02 21:48:43', '2021-10-05 23:24:04'),
(16, 3, 'Ayam Geprek Sambal Ijo - 5', 'Ayam geprek dilengkapi dengan sambal ijo  menambah cita rasa tersendiri dan meningkatkan nafsu makan', '2021-10-06-615d330932d1b.png', NULL, 43, NULL, NULL, '[{\"id\":\"6\",\"position\":1},{\"id\":\"43\",\"position\":2}]', '[]', '[]', '[]', '[]', '37500.00', '0.00', 'percent', '0.00', 'percent', '17:00:00', '20:00:00', 0, 1, 1, '2021-09-02 21:53:07', '2021-10-22 02:22:57'),
(17, 3, 'Ayam Geprek Original - 5', 'Ayam geprek dengan rasanya yang gurih dan nikmat meningkatkan selera makan', '2021-10-07-615e369ece465.png', NULL, 43, NULL, NULL, '[{\"id\":\"6\",\"position\":1},{\"id\":\"43\",\"position\":2}]', '[]', '[]', '[]', '[]', '37500.00', '0.00', 'percent', '0.00', 'percent', '17:00:00', '20:00:00', 0, 1, 0, '2021-09-02 23:05:17', '2021-10-06 17:51:58'),
(18, 3, 'Nasi Goreng seafood - 5', 'Penambahan bahan seafood ini membuat cita rasa nasi goreng makin menggoda. Kandungan gizi dan protein yang terkandung didalamnya juga sangat bagus untuk kesehatan.', '2021-10-06-615d33a2e4845.png', NULL, 32, NULL, NULL, '[{\"id\":\"10\",\"position\":1},{\"id\":\"32\",\"position\":2}]', '[]', '[]', '[]', '[]', '22500.00', '0.00', 'percent', '0.00', 'percent', '17:00:00', '20:00:00', 0, 1, 0, '2021-09-02 23:17:08', '2021-10-05 23:26:58'),
