(2663, 126, 'Susu Kurma Ansara', 'Susu Kurma ini dibuat dari (susu UHT plain + kurma sukari). \r\n\r\n Enak. Sehat. Lezat. Murah.\r\n TANPA gula. Manis asli dari kurma nya.\r\n Bikin mood happy.\r\n ASI Booster.\r\n Jangan salah fokus dgn \"ASI boosternya\" yah, krn susukurma baik utk anak2 >1thn, wanita, ibu hamil & menyusui, pria, hingga lansia..\r\n.\r\nManfaat susu kurma :\r\n1. Meningkatkan daya tahan tubuh\r\n2. Menjaga kesehatan mata\r\n3. Kaya akan potasium (kalium) yang dapat menstabilkan tekanan darah & menjaga kesehatan jantung\r\n4. Membantu atasi anemia, krn kaya akan zat besi pd susu&kurma.\r\n5. Melancarkan buang air kecil\r\n6. Menyehatkan tulang dan sendi\r\n7. Melancarkan pencernaan, krn kaya akan serat.\r\n8. Meningkatkan produksi ASI\r\n.\r\n  (HALAL)', 'https://res.cloudinary.com/borneos-co/image/upload/v1652352556/images/products/ucgrylk7qvjm4vmcmalx.jpg', '{\"public_id\":\"images\\/products\\/ucgrylk7qvjm4vmcmalx\",\"file_type\":\"image\",\"size\":\"226.87 KB\",\"width\":1083,\"height\":1083,\"extension\":\"jpg\"}', 3, NULL, NULL, '[{\"id\":\"3\",\"position\":0}]', '[]', '[]', '[]', '[]', '13000.00', '0.00', 'percent', '0.00', 'percent', '08:00:00', '16:00:00', 0, 1, 0, '2022-03-06 02:33:47', '2022-05-12 04:49:15'),
